import styled from "styled-components";

export const Bar = styled.div`
    position: absolute;
    left: 0%;
    right: 0%;
    top: 0%;
    bottom: 0%;
    background: #FFFFFF;
    box-shadow: 0px 8px 24px -10px rgba(0, 0, 0, 0.24);
`;

export const Header: React.FC = () => {
    return (
        <div>Header</div>
    )
}
